import styled from "styled-components";

export const GameContainer = styled.div`
    position: fixed;
    width: 100%;
    height: 100%;
    //background: linear-gradient(rgb(45,56,86), rgb(45,56,86),rgb(224,75,119));
    background-color: #3a3b3c;
`;

export const GamePlayer = styled.div`
    width: 80vw;
    height: 80vw;
    max-width: 700px;
    max-height: 700px;
    margin-top: 30px;
`;
